import React from 'react';
import {Navbar,Nav,NavbarBrand} from 'react-bootstrap/Navbar'
class Navbars extends React.Component {
    render(){
     return (
 <div>
    <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">   
    <img
    alt=""
    src="https://i0.wp.com/blog.logrocket.com/wp-content/uploads/2018/05/react-bootstrap-tutorial.png?fit=544%2C472&ssl=1"
    width="30"
    height="30"
    className="d-inline-block align-top"
    />
    {'EraMint'}
    </Navbar.Brand>

    <Nav>
    <Nav.Link href="#deets" >More deets</Nav.Link>

    </Nav>

    </Navbar>
</div>
        )
    }
}
export default Navbars;
